import { Header } from "./Header"
import { BrowserRouter as Router, Switch, NavLink } from "react-router-dom";
import "./styles.css";

const Main = () => {

  return (
    <>
      <Header titulo='Mis Tareas' />
      <Router>
        <main className="main bg-light">
          <button className='btn btn-dark'>Agregar Tareas</button>
        </main>
      </ Router>
    </>
  );
};

export { Main };
